$("document").ready(function(){$(document).on("click",'a[href^="#"]',function(o){o.preventDefault(),$("html, body").animate({scrollTop:$($.attr(this,"href")).offset().top-65},500)}),$(window).scroll(function(){$(".fade-in-section").each(function(o){$(this).position().top+50<$(window).scrollTop()+$(window).height()&&$(this).addClass("is-visible")})})});